import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "navigation-up-arrow";
const pathData = "M258.5 237l-102 103c-6 6-14 9-22 9s-15-3-22-9c-6-7-9-14-9-22s3-16 9-22l124-124c7-6 14-9 22-9s16 3 22 9l124 124c6 6 9 14 9 22s-3 15-9 22c-6 6-14 9-22 9s-15-3-22-9z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
